fetch("https://3zh9uaj4n3dl5zbo.public.blob.vercel-storage.com/tutor_data.json").then((e=>{if(!e.ok)throw new Error("Network response was not ok");return e.json()})).then((e=>{let t=e,r=document.getElementById("tutor-card-container"),o=document.getElementById("example-tutor-card");t.forEach((e=>{new_tutor_card=o.cloneNode(!0),new_tutor_card.querySelector(".name-data").textContent=e.first_name+" "+e.last_name,new_tutor_card.querySelector(".grade-data").textContent=e.grade,new_tutor_card.querySelector(".subject-data").textContent="Can teach: "+e.subjects.join(", "),new_tutor_card.querySelector("img").src=e.photo,r.append(new_tutor_card)})),o.remove()})).catch((e=>{console.error("There was a problem with the fetch operation:",e)}));